import axios from 'axios';

const API_BASE_URL = 'localhost:3000/user/';

export const registerUser = async (username:string, password:string) => {
  try {
    const response = await axios.post(`${API_BASE_URL}register`, {
      username,
      password
    });


    return response.data;
  } catch (error) {
    throw error;
  }
};
